def moving_average(data, window_size):
    """
    计算数据的移动平均值
    :param data: 原始数据数组
    :param window_size: 平均窗口大小
    :return: 平滑后的数据
    """
    return np.convolve(data, np.ones(window_size) / window_size, mode='valid')

def plot_delay(map,ylab='Reward'):
    delay = map[0]
    load = map[1]
    action = map[2]

    load = min_max_scaler(load, max(load), min(load))
    delay = min_max_scaler(delay, 1.5, 0)
    delay = pd.Series(delay).rolling(window=5, center=True).mean()
    load = pd.Series(load).rolling(window=5, center=True).mean()
    expanded_list = [item for item in action for _ in range(10)]

    map = [delay,load]
    ## 黄色：能耗 绿色：负载 蓝色：延迟
    i = 0
    # 创建图表和第一个y轴
    fig, ax1 = plt.subplots()

    # 绘制第一个y轴的数据
    color = 'tab:red'
    ax1.set_ylabel(ylab)
    ax1.set_xlabel('时隙')
    ax1.tick_params(axis='y')
    s = "ygb"
    name = ['归一化负载', '归一化时延','全部关闭']
    touming = [0.5,0.8]
    # 创建第二个y轴，共享相同的x轴
      # 创建次y轴

    for i in range(2):
        ax1.plot(np.arange(len(map[i])), map[i], color=s[i], label= name[i],alpha=touming[i])

    ax2 = ax1.twinx()
    line2 = ax2.set_ylabel('处于工作状态的移动服务器总数')  # 设置次y轴的标签
    ax2.plot(np.arange(len(expanded_list)), expanded_list, color=color, label='激活移动服务器总数')
    ax2.tick_params(axis='y')

    lines, labels = ax1.get_legend_handles_labels()
    lines2, labels2 = ax2.get_legend_handles_labels()
    ax2.legend(lines + lines2, labels + labels2, loc='lower right')
    plt.rcParams['font.sans-serif'] = ['SimHei']  # 使用黑体字体
    plt.rcParams['axes.unicode_minus'] = False  # 正确显示负号
    plt.savefig('对比负载' + '.svg', format='svg')
    plt.show()

