def plot_cover(map, isSmooth=False, window_size=5, polyorder=3):
        if isSmooth:
            # 应用平滑
            map[0] = savgol_filter(map[0], window_size, polyorder)
            map[3] = savgol_filter(map[3], window_size, polyorder)
            map[2] = savgol_filter(map[2], window_size, polyorder)
            map[1] = savgol_filter(map[1], window_size, polyorder)
        name = ['全部开启', '全部关闭', 'TOP-K','DQN-DD']
        colors = ['b', 'y', 'g', 'r']
        plt.plot(map[0], label=name[0], color=colors[0])
        plt.plot(map[1], label=name[1], color=colors[1])
        plt.plot(map[3], label=name[3], color=colors[3])
        plt.plot(map[2], label=name[2], color=colors[2])
        handles = [plt.Line2D([0], [0], color=color, label=label)
                   for color,label in zip(colors, name)]
        plt.ylabel('系统总成本')
        plt.rcParams['font.sans-serif'] = ['SimHei']  # 使用黑体
        plt.rcParams['axes.unicode_minus'] = False  # 正确显示负号
        plt.xlabel('迭代次数')
        plt.legend(handles=handles)
        plt.savefig('收敛.svg', format='svg')
        plt.show()
def min_max_scaler(data,max_value,min_value):
    return [(x - min_value) / (max_value - min_value) for x in data]


def apply_random_factor_to_list(cost_list, min_factor=0.9995, max_factor=1.0005):
    fluctuated_costs = []
    for cost in cost_list:
        factor = random.uniform(min_factor, max_factor)
        fluctuated_cost = cost * factor
        fluctuated_costs.append(fluctuated_cost)
    return fluctuated_costs

